class Solution:
    def minDominoRotations(self, A, B) -> int:
        top, bot = A[0], B[0]
        top_feas, bot_feas = True, True
        top_rot, bot_rot = 0, 0
        top_dup , bot_dup = 0, 0
        for i in range(1, len(A)):
            if top_feas:
                if A[i] == B[i]:
                    if top != A[i]:
                        top_feas = False
                    else:
                        top_dup += 1
                elif B[i] == top:
                    top_rot += 1
                elif A[i] != top:
                    top_feas = False
            if bot_feas:
                if A[i] == B[i]:
                    if bot != A[i]:
                        bot_feas = False
                    else:
                        bot_dup += 1
                elif A[i] == bot:
                    bot_rot += 1
                elif B[i] != bot:
                    bot_feas = False
        if top_feas and bot_feas:
            return min(top_rot, len(A) - top_rot, bot_rot, len(A) - bot_rot)
        elif top_feas:
            return min(top_rot, len(A) - top_rot - top_dup)
        elif bot_feas:
            return min(bot_rot, len(A) - bot_rot - bot_dup)
        return -1


